import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        Хеллоу
      </div>
    );
  }
}

class MyComponent {
  render() {
    return (
        <div>
            <a href="vk.com">Моя ссылка</a>
        </div>
    );
  }
}

export default App;
